const findDistrictMarkers = (district, markers) => {
  const districtMarkers = [];
  markers.forEach((marker) => {
    if (district === marker.district) {
      districtMarkers.push(marker)
    }
  })
  return districtMarkers;
}

const computeAverageDistrict = (districtMarkers) => {
  let averageTotal = 0;

  districtMarkers.forEach((marker) => {
    if (marker.average) {
      averageTotal += marker.average;

    }
  })
  return averageTotal / districtMarkers.length
}

const setColor = (average) => {

  if (average === null) {
    return '#128AB2'
  } else if (average < 3) {
    return 'red';
  } else if (average < 4) {
    return 'orange';
  } else {
    return 'green';
  }
}


const initMapbox = () => {
  let mapElement

  // establishments index
  if (document.getElementById('map')) {
    mapElement = document.getElementById('map');

    const markers = JSON.parse(mapElement.dataset.markers);

    // Geolocation
    const geolocate = new mapboxgl.GeolocateControl({
    positionOptions: {
    enableHighAccuracy: true
    },
    trackUserLocation: true
    });


    const fitMapToMarkers = (map, markers) => {

      const bounds = new mapboxgl.LngLatBounds();
      markers.forEach(marker => bounds.extend([ marker.lng, marker.lat ]));

      fetch("https://opendata.bordeaux-metropole.fr/api/records/1.0/search/?dataset=bor_sigquartiers&q=")
        .then(response => response.json())
        .then((data) => {
          map.on('load', function() {
            data.records.forEach((element) => {
              let colorDistrict = '#128AB2';
              const districtMarkers = findDistrictMarkers(element.fields.nom, markers)
              if (districtMarkers.length !== 0) {
                const averageDistrict = computeAverageDistrict(districtMarkers)
                colorDistrict = setColor(averageDistrict)
                }
                map.addSource(element.fields.nom, {
                  'type': 'geojson',
                  'data': {
                    'type': 'Feature',
                    'geometry': element.fields.geometrie
                    }
                })
                map.addLayer({
                'id': element.fields.nom,
                'type': 'fill',
                'source': element.fields.nom,
                'layout': {},
                'paint': {
                'fill-color': colorDistrict,
                'fill-opacity': 0.5
                }
              });
            })
          })
        });


    //district bdx and CUB - no copmplet
    // map.on('load', function() {
    //   districts().features.forEach((element) => {
    //     map.addSource(element.properties.nom, {
    //       'type': 'geojson',
    //       'data': {
    //         'type': 'Feature',
    //         'geometry': element.geometry
    //         }
    //     })

    //     map.addLayer({
    //     'id': element.properties.nom,
    //     'type': 'fill',
    //     'source': element.properties.nom,
    //     'layout': {},
    //     'paint': {
    //     'fill-color': '#088',
    //     'fill-opacity': 0.8
    //     }
    //   });
    //   })
    // })


      map.fitBounds(bounds, { padding: 70, maxZoom: 15, duration: 0 });
    };

    if (mapElement) { // only build a map if there's a div#map to inject into
      mapboxgl.accessToken = mapElement.dataset.mapboxApiKey;
      const map = new mapboxgl.Map({
        container: 'map',
        style: 'mapbox://styles/mapbox/streets-v10',
      });

      map.addControl(geolocate);
      geolocate.on('geolocate', function() {
        console.log('A geolocate event has occurred.')
      });

      markers.forEach((marker) => {
        const el = document.createElement('div');
        const category = marker.category;
        const color = setColor(marker.average)
        el.className = `marker-${category}-${color}`;
      new mapboxgl.Marker( el )
        .setLngLat([ marker.lng, marker.lat ])
        .setPopup(new mapboxgl.Popup({ offset: 25 }) // add popups
        .setHTML(`<a href="establishments/${marker.id}">
          <h3> ${marker.name} </h3><p> ${marker.description} </p>
          </a>`
          ))
        .addTo(map);
      });
      fitMapToMarkers(map, markers);

    }
  // establishments show
  } else if (document.getElementById('map-show')) {
    mapElement = document.getElementById('map-show');
    const marker = JSON.parse(mapElement.dataset.marker);

    // Geolocation
    const geolocate = new mapboxgl.GeolocateControl({
    positionOptions: {
    enableHighAccuracy: true
    },
    trackUserLocation: true
    });

    const fitMapToMarker = (map, marker) => {
    const bounds = new mapboxgl.LngLatBounds();
    bounds.extend([ marker.lng, marker.lat ]);
    map.fitBounds(bounds, { padding: 70, maxZoom: 14, duration: 0 });
  };

    if (mapElement) { // only build a map if there's a div#map to inject into
      mapboxgl.accessToken = mapElement.dataset.mapboxApiKey;
      const map = new mapboxgl.Map({
        container: 'map-show',
        style: 'mapbox://styles/mapbox/streets-v10'
      });

      map.addControl(geolocate);
      geolocate.on('geolocate', function() {
      console.log('A geolocate event has occurred.')
     });
      const el = document.createElement('div');
      const category = marker.category;
      const color = setColor(marker.average)
      el.className = `marker-${category}-${color}`;
      new mapboxgl.Marker( el)
        .setLngLat([ marker.lng, marker.lat ])
        .addTo(map);
    fitMapToMarker(map, marker);

    }
  }
};




export { initMapbox };
export { setColor };
